import { BrowserRouter , Route, Routes } from 'react-router-dom';
import Nav from "./nav";
import Home from "./home";
import About from "./about";
import './App.css';





class App extends React.Component {
  render(){

    return (
      <BrowserRouter>
    <div>
        {/* <Home /> */}
        {/* <Routes> */}
        <Routes>
        <Nav />

          <Route path="/" component={Home} />
          <Route path="/about" component={About} />
        </Routes>
        {/* </Routes> */}
      </div>
    </BrowserRouter>
  );
}
}

export default App;
